get.description:
This endpoint will retrieve event's registration types by eventID.

**RESPONSES**

``` json
{
    "data": {
        "registration_type": [
            {
                "id": 142,
                "eventID": 123,
                "title": "registration type 1",
                "description": "registration type 1"
            },
            {
                "id": 143,
                "eventID": 123,
                "title": "registration type 2",
                "description": "registration type 2"
            }
        ],
        "success": true
    },
    "error": false,
    "messages": []
}

 ```

